import Dayplanner from "../Portfolio/images/dayplanner.png"
import './style.css';

export default function Portfolio() {
    // const match = useRouteMatch();

    return (
        <>
        <div className="viewContainer ">
            <h1>This is where my portfolio will go!</h1>
            <div className="projectBox">
              <a href="https://joeldelatte.github.io/day-planner/">
                <img className="projectPhoto" src={Dayplanner}></img>
                <section className="projectLabel">Day Planner</section>
              </a>  
            </div>
            <div className="projectBox">
              <a href="https://joeldelatte.github.io/password-generator/">
                <img class="projectPhoto" src="../images/lock.png"></img> 
                <section className="projectLabel">Password Generator</section>
              </a>  
            </div>        
            <div className="projectBox">
              <a href="https://mmoritz8.github.io/Project-1/Joel_art/arts.html">
                <img className="projectPhoto" src="../images/austin1.jpeg"></img>
                <section className="projectLabel">Austin Tribune</section>
              </a>
            </div>
            <div className="projectBox">
              <a href="https://boiling-lowlands-78090.herokuapp.com/">
                <img className="projectPhoto" src="../images/burger.jpg"></img>
                <section className="projectLabel">Burger-Time</section>
              </a>
            </div>
            <div className="projectBox">
              <a href="https://rocky-dawn-34385.herokuapp.com/">
                <img className="projectPhoto" src="../images/laptop.png"></img>            
                <section className="projectLabel">Code Tabs</section>
              </a>
            </div>                                                              
        </div>
        </>
    )
}

